                    // 获取自定义属性 data-type 的值
                    const type = event.currentTarget.dataset.type;
                    // console.log(`Mouse over ${type}`);
                    this.$refs[type].style.display = 'block'
                },
                //鼠标离开事件
                handleMouseOut(event) {
                    const type = event.currentTarget.dataset.type;
                    this.$refs[type].style.display = 'none'
                    // this.$refs['Brain_Cerebellum_hover'].style.display = 'none'
                },

                redirectToSomePage(value) {
                    window.open('http://123.139.129.138:61231/analyze/cellmarkers/human-data?organ=' + value, '_blank')
                }
            }
        })
    </script>
</body>

</html>
